import Vue from "vue";
import VueRouter from "vue-router";


import Home from "./pages/Home/Home";


Vue.use(VueRouter);

export const routes = [
    //PAGE ORIENTATION
    { path: "*", redirect: "/" },
];




export const router = new VueRouter({
    mode: "history",
    routes,
});
